import './App.css';
import ChatBot from './ChatBot';
import Header from './Header';
import Home from './Home';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Menu from './Menu';
import FormsList from './FormsList';
import React from 'react';
import OCR from './OCR';

function App() {
  return (
    <div>
      {/* <OCR/> */}
      <Router>
        <Routes>
          <Route exact path='/' component={Login} />
          <Route exact path='/marktemp' component={MarkTemp} />
          <Route exact path='/login' component={Login} />
          <Route exact path='/signup' component={Signup} />
          <Route exact path='/users' component={ViewUsers} />
          <Route exact path='/logout' component={Logout} />
          <Route exact path='/prevtemplates' component={PrevTemplates} />
          <Route exact path='/template/:tid' component={ShowTemplate} />
          <Route exact path='/data/:tid' component={ShowData} />
          <Route exact path='/getdata' component={GetData} />
          <Route exact path='/viewdata/:tid/:did' component={ViewData} />
          <Route exact path='/ocr' Component={OCR} />
          <Route exact path='/formsList' element={<React.Fragment>
            <Header />
            <FormsList />
          </React.Fragment>}>
          </Route>
          <Route exact path='/menu' element={<React.Fragment>
            <Header />
            <Menu />
          </React.Fragment>}>
          </Route>
          <Route exact path='/chatBot' element={<React.Fragment>
            <Header />
            <ChatBot />
          </React.Fragment>}>
          </Route>
          <Route exact path='/' element={<React.Fragment>
            <Header />
            <Home />
          </React.Fragment>}>
          </Route>
        </Routes>
      </Router>
    </div>
  );
}

export default App;
